import "./App.css";
import { BasicTable } from "./BasicTable";
import { QueryClient, QueryClientProvider } from "react-query";
function App() {
  const queryClient = new QueryClient();
  return (
    <QueryClientProvider client={new QueryClient()}>
      <BasicTable />
    </QueryClientProvider>
  );
}

export default App;
